import React from "react";
import { useSelector } from "react-redux";

export default function PokemonList() {
  const pokemons = useSelector((state) => state.pokemonAddSlice.pokemonList);
  const pokemonsTodisplayLi = pokemons.map((pokemon) => (
    <li> {pokemon.name} </li>
  ));
  return <ul> {pokemonsTodisplayLi} </ul>;
}
